const { assert } = require('chai')
const { Script, Ops } = require('../index')


let script1, script2;
before(() => {
  script1 = new Script([
    Ops.OP_FALSE,
    Ops.OP_RETURN,
    'hello',
    'world'
  ])

  script2 = new Script([
    Ops.OP_DUP,
    Ops.OP_HASH160,
    [106, 252, 13, 107, 181, 120, 40, 42, 192, 246, 173, 92, 90, 242, 41, 76, 25, 113, 33, 8],
    Ops.OP_EQUALVERIFY,
    Ops.OP_CHECKSIG
  ])
})


describe('new Script()', () => {
  it('must instantiate a new script', () => {
    const script = new Script()
    assert.instanceOf(script, Script)
    assert.lengthOf(script.chunks, 0)
  })

  it('must instantiate a new script with chunks', () => {
    assert.instanceOf(script1, Script)
    assert.lengthOf(script1.chunks, 4)
  })
})


describe('Script#fromHex()', () => {
  it('must parse a script from the hex string', () => {
    const script = Script.fromHex('76a9146afc0d6bb578282ac0f6ad5c5af2294c1971210888ac')
    assert.instanceOf(script, Script)
    assert.lengthOf(script.chunks, 5)
    assert.equal(script.chunks[1].op, 'OP_HASH160')
    assert.equal(script.chunks[4].op, 'OP_CHECKSIG')
  })
})


describe('Script#toBuffer()', () => {
  it('must return a data buffer', () => {
    const buf = script2.toBuffer()
    assert.instanceOf(buf, Buffer)
    assert.lengthOf(buf, 25)
  })
})


describe('Script#toHex()', () => {
  it('must return a hex string', () => {
    const hex = script2.toHex()
    assert.equal(hex, '76a9146afc0d6bb578282ac0f6ad5c5af2294c1971210888ac')
  })
})


