  it('must serialize and parse using hex', () => {
    const script1 = new Script([
      Ops.OP_FALSE,
      Ops.OP_RETURN,
      b512,
      b66000
    ])

    const hex = script1.toHex()
    const script2 = Script.fromHex(hex)
    
    assert.lengthOf(script2.chunks, 4)
    assert.equal(script2.chunks[2].toString(), b512)
    assert.equal(script2.chunks[3].toString(), b66000)
  })

  it('must serialize and parse using ASM', () => {
    const script1 = new Script([
      Ops.OP_FALSE,
      Ops.OP_RETURN,
      b512,
      b66000
    ])

    const asm = script1.toASM()
    const script2 = Script.fromASM(asm)
    
    assert.lengthOf(script2.chunks, 4)
    assert.equal(script2.chunks[2].toString(), b512)
    assert.equal(script2.chunks[3].toString(), b66000)
  })
